(8, 1, '2021-02-27 12:43:35', '2021-02-27 12:43:35', '<h2>We do easiest solution for you.</h2>		\n		<h4><strong>We are a team of young people who are energetic, skilled and experienced. Our aim is IT based solution making with GIS, RS. We are used to commercial and non applications and already we have done some projects for different organizations at different times.</strong></h4>		\n										<img width=\"150\" height=\"150\" src=\"https://mapbd.xyz/wp-content/uploads/2021/02/scoop-it-logoWh-150x150.png\" alt=\"\" loading=\"lazy\" srcset=\"https://mapbd.xyz/wp-content/uploads/2021/02/scoop-it-logoWh-150x150.png 150w, https://mapbd.xyz/wp-content/uploads/2021/02/scoop-it-logoWh-300x300.png 300w, https://mapbd.xyz/wp-content/uploads/2021/02/scoop-it-logoWh.png 512w\" sizes=\"(max-width: 150px) 100vw, 150px\" />											\n										<img width=\"150\" height=\"150\" src=\"https://mapbd.xyz/wp-content/uploads/2021/02/earth-globeWh-150x150.png\" alt=\"\" loading=\"lazy\" srcset=\"https://mapbd.xyz/wp-content/uploads/2021/02/earth-globeWh-150x150.png 150w, https://mapbd.xyz/wp-content/uploads/2021/02/earth-globeWh-300x300.png 300w, https://mapbd.xyz/wp-content/uploads/2021/02/earth-globeWh.png 512w\" sizes=\"(max-width: 150px) 100vw, 150px\" />											\n										<img width=\"150\" height=\"150\" src=\"https://mapbd.xyz/wp-content/uploads/2021/02/locationWh-150x150.png\" alt=\"\" loading=\"lazy\" srcset=\"https://mapbd.xyz/wp-content/uploads/2021/02/locationWh-150x150.png 150w, https://mapbd.xyz/wp-content/uploads/2021/02/locationWh-300x300.png 300w, https://mapbd.xyz/wp-content/uploads/2021/02/locationWh.png 512w\" sizes=\"(max-width: 150px) 100vw, 150px\" />', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2021-03-27 00:03:42', '2021-03-26 18:03:42', '', 0, 'https://mapbd.xyz/?page_id=8', 0, 'page', '', 0),
